import { Card, CardHeader, IconButton, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from '@mui/material'
import React, { useState } from 'react'
import { useSelector } from 'react-redux';

export default function Category() {
  const { auth, restaurant } = useSelector(store => store);
  const [openCreateCategory, setOpenCreateCategory] = useState(false);

  const handleOpenChangeCategory = () => 
    setOpenCreateCategory(!openCreateCategory);

  return (
    <Card className='mt-1'>
      <CardHeader
        title={"Categories"}
        sx={{
          pt: 2, 
          alignItems: "center", 
          "& .MuiCardHeader-action": { mt: 0.6},
        }}
        action={
          <IconButton onClick={handleOpenChangeCategory}/>
        }
      />
      <TableContainer>
        <Table sx={{}} aria-label= "table in dashboard">
          <TableHead>
            <TableRow>
              <TableCell>
                Id
              </TableCell>
              <TableCell>
                Name
              </TableCell>
            </TableRow>
          </TableHead>

          <TableBody>
            {}
          </TableBody>

        </Table>
      </TableContainer>
    </Card>
  )
}
